import styles from "./Navbar.module.css";
import logo from "../../Assets/Images/Movies.svg";
import { useState } from "react";
import Button from "../../Components/Button/Button";

const Navbar = (props) => {
  // Define el elemento seleccionado en la navbar
  const [navbar, setNavbar] = useState(1);
  let toggleNavbar = (value) => {
    setNavbar(value);
  };

  const [userLogged, setUserLogged] = useState(false);

  let HtmlNavbar = (
    // Contenedor externo
    <div className="h-screen bg-black">
      {/* Contenedor de la navbar */}
      <div
        className={`${styles.navbarContainer} flex justify-between items-center px-20 border-b-2 border-b-white/20 bg-gradient-to-b from-black`}
      >
        {/* Logo de la pagina */}
        <img
          onClick={() => {
            toggleNavbar(1);
          }}
          src={logo}
          alt="Logo"
          className="h-2/4 cursor-pointer"
        />

        {/* Contenedor del menu de navegacion */}
        <div className="h-full items-center hidden md:flex">
          <div
            onClick={() => {
              toggleNavbar(1);
            }}
            className={
              `flex items-center h-full hover:bg-gradient-to-t hover:from-primary/20 cursor-pointer ` +
              (navbar === 1
                ? `border-b-2 border-b-primary from-primary/20`
                : ``)
            }
          >
            <p
              className={
                `text-2xl mx-5 ` +
                (navbar === 1 ? `text-primary` : `text-white`)
              }
            >
              Peliculas
            </p>
          </div>
          <div
            onClick={() => {
              toggleNavbar(2);
            }}
            className={
              `flex items-center h-full hover:bg-gradient-to-t hover:from-primary/20 cursor-pointer  ` +
              (navbar === 2
                ? `border-b-2 border-b-primary from-primary/20`
                : ``)
            }
          >
            <p
              className={
                `text-2xl mx-5 ` +
                (navbar === 2 ? `text-primary` : `text-white`)
              }
            >
              Series
            </p>
          </div>
        </div>

        {/* Contenedor del area del perfil de usuario e inicio de sesion */}

        {userLogued ? (
          <div className="hidden md:block">
            <Button text="LOGUEADO"></Button>
          </div>
        ) : (
          <div className="hidden md:block">
            <Button text="Iniciar SesiÃ³n"></Button>
          </div>
        )}
      </div>

      {/* Contenedor del contenido de la pantalla */}
      <div className={styles.contentContainer}>{props.component}</div>
    </div>
  );
  return HtmlNavbar;
};

export default Navbar;
